import React, { Component } from 'react';

function ListItems(props){
  const Items = props.added_elements.map((added_element) =>
  <li key={added_element}>{added_element}</li>
);
  return (<ul>{Items}</ul>);
}


class GroceryList extends Component{
  constructor(props) {
    super(props);
    this.state = {added_elements:[]};
  }

addItem(item){
  this.setState({added_elements:added_elements.push(item)});
}

  render(){
    return(
      <div>
        <ListItems added_elements={this.state.added_elements} />
      </div>
    );
  }
}


export default GroceryList;
